from py4godot.wrappers.wrappers import CPPSceneTreeWrapper

class GroupCallFlags:
  GROUP_CALL_DEFAULT = 0
  GROUP_CALL_REVERSE = 1
  GROUP_CALL_DEFERRED = 2
  GROUP_CALL_UNIQUE = 4


class SceneTree(py4godot_mainloop.MainLoop):
  r'''
		As one of the most important classes, the `SceneTree` manages the hierarchy of nodes in a scene, as well as scenes themselves. Nodes can be added, fetched and removed. The whole scene tree (and thus the current scene) can be paused. Scenes can be loaded, switched and reloaded.
		You can also use the `SceneTree` to organize your nodes into **groups**: every node can be added to as many groups as you want to create, e.g. an "enemy" group. You can then iterate these groups or even call methods and set properties on all the nodes belonging to any given group.
		`SceneTree` is the default `MainLoop` implementation used by the engine, and is thus in charge of the game loop.
	'''

  @staticmethod
  def constructor():
    class_ = SceneTree.construct_without_init()
    class_._ptr = constructor(719,0, ())
    return class_
  @staticmethod
  def new():
    class_ = SceneTree.construct_without_init()
    class_._ptr = constructor(719,0, ())
    return class_
  def __init__(self):
    self._ptr =  CPPSceneTreeWrapper()
    if c_utils.shouldCreateObject:
      self._ptr = constructor(719,0, ())


  def generate_wrapper(self):
    return CPPSceneTreeWrapper()
  def init_signals(self):
    super().init_signals()
    tree_changed_name = utils.py_string_to_string_name("tree_changed")
    self.tree_changed = signals.BuiltinSignal(self, tree_changed_name)
    scene_changed_name = utils.py_string_to_string_name("scene_changed")
    self.scene_changed = signals.BuiltinSignal(self, scene_changed_name)
    tree_process_mode_changed_name = utils.py_string_to_string_name("tree_process_mode_changed")
    self.tree_process_mode_changed = signals.BuiltinSignal(self, tree_process_mode_changed_name)
    node_added_name = utils.py_string_to_string_name("node_added")
    self.node_added = signals.BuiltinSignal(self, node_added_name)
    node_removed_name = utils.py_string_to_string_name("node_removed")
    self.node_removed = signals.BuiltinSignal(self, node_removed_name)
    node_renamed_name = utils.py_string_to_string_name("node_renamed")
    self.node_renamed = signals.BuiltinSignal(self, node_renamed_name)
    node_configuration_warning_changed_name = utils.py_string_to_string_name("node_configuration_warning_changed")
    self.node_configuration_warning_changed = signals.BuiltinSignal(self, node_configuration_warning_changed_name)
